import React from 'react'
import   './ContactsView.css';

export default function ContactsView({contact}) {
  return (
    <div>

<p id='box'>
  
     your  name {contact.name}
      <br/>
     your age {contact.age}
      <br/>
      {contact.number}
</p>
    </div>
  )
}
